    false,nt"url": null,nt"notes": "nThis dataset is distributed by the National
    Oceanic and Atmospheric Administration (NOAA) Great Lakes Environmental Research
    Laboratory (GLERL). The atlas contains data on over 1200 digitized Great Lakes ice
    charts for winters from 1973 to 2002 and three types of analysis products.The first
    analysis product includes ice charts of the following: dates of the first reported
    ice, dates of the last reported ice, and ice duration for each winter, as well as,
    the maximum, minimum and average ice cover concentrations.The second analysis product
    is a 30-year set of annual daily ice cover time series. The daily time series was
    used to create: 1) computer animations of spatial patterns of ice cover for each
    winter, 2) line plots of lake averaged ice cover for each lake over the 30 winters.The
    third analysis product is weekly statistics. There are weekly ice charts and grids
    of: maximum, 3rd quartile, median, 1st quartile, and minimum ice cover concentrations
    for the 30-winter base period. The weekly statistics are based on the original ice
    chart data set and not on the daily time series.NSIDC does not distribute this data
    set. Please contact the investigator or data compiler to acquire these data, and
    for further information about these data. Data Compiler: <A HREF='http://www.glerl.noaa.gov/data/ice/atlas/'>NOAA
    Great Lakes Environmental Research Laboratory</A>n",nt"license_title": null,nt"extras":
